"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[7151],{111:(e,t,s)=>{s.r(t),s.d(t,{default:()=>o,johnChapter10ES:()=>r});const r={chapter:10,title:"Jean 10",version:"Reina-Valera 1909",language:"es",direction:"ltr",verses:[{number:1,text:"De cierto, de cierto os digo: El que no entra por la puerta en el corral de las ovejas, mas sube por otra parte, el tal es ladr\xf3n y robador.",strong:[{text:"dans",strong:"H6887",start:73,end:77}]},{number:2,text:"Mas el que entra por la puerta, el pastor de las ovejas es.",strong:[{text:"pastor",strong:"G4166",start:35,end:41}]},{number:3,text:"A \xe9ste abre el portero, y las ovejas oyen su voz: y \xe1 sus ovejas llama por nombre, y las saca.",strong:[{text:"nombre",strong:"G3686",start:75,end:81}]},{number:4,text:"Y como ha sacado fuera todas las propias, va delante de ellas; y las ovejas le siguen, porque conocen su voz.",strong:[{text:"como",strong:"G2531",start:2,end:6}]},{number:5,text:"Mas al extra\xf1o no seguir\xe1n, antes huir\xe1n de \xe9l: porque no conocen la voz de los extra\xf1os.",strong:[]},{number:6,text:"Esta par\xe1bola les dijo Jes\xfas; mas ellos no entendieron qu\xe9 era lo que les dec\xeda.",strong:[{text:"Esta",strong:"G3778",start:0,end:4}]},{number:7,text:"Volvi\xf3les, pues, Jes\xfas \xe1 decir: De cierto, de cierto os digo: Yo soy la puerta de las ovejas.",strong:[{text:"decir",strong:"H559",start:25,end:30}]},{number:8,text:"Todos los que antes de m\xed vinieron, ladrones son y robadores; mas no los oyeron las ovejas.",strong:[{text:"brebis",strong:"G4263",start:78,end:84}]},{number:9,text:"Yo soy la puerta: el que por m\xed entrare, ser\xe1 salvo; y entrar\xe1, y saldr\xe1, y hallar\xe1 pastos.",strong:[]},{number:10,text:"El ladr\xf3n no viene sino para hurtar, y matar, y destruir: yo he venido para que tengan vida, y para que la tengan en abundancia.",strong:[{text:"destruir",strong:"G622",start:48,end:56},{text:"vida",strong:"G2222",start:87,end:91},{text:"abundancia",strong:"G4138",start:117,end:127}]},{number:11,text:"Yo soy el buen pastor: el buen pastor su vida da por las ovejas.",strong:[{text:"pastor",strong:"G4166",start:15,end:21},{text:"pastor",strong:"G4166",start:31,end:37},{text:"vida",strong:"G2222",start:41,end:45}]},{number:12,text:"Mas el asalariado, y que no es el pastor, de quien no son propias las ovejas, ve al lobo que viene, y deja las ovejas, y huye, y el lobo las arrebata, y esparce las ovejas.",strong:[{text:"pastor",strong:"G4166",start:34,end:40}]},{number:13,text:"As\xed que, el asalariado, huye, porque es asalariado, y no tiene cuidado de las ovejas.",strong:[{text:"brebis",strong:"G4263",start:90,end:96}]},{number:14,text:"Yo soy el buen pastor; y conozco mis ovejas, y las m\xedas me conocen.",strong:[{text:"pastor",strong:"G4166",start:15,end:21}]},{number:15,text:"Como el Padre me conoce, y yo conozco al Padre; y pongo mi vida por las ovejas.",strong:[{text:"Como",strong:"G2531",start:0,end:4},{text:"Padre",strong:"G3962",start:8,end:13},{text:"Padre",strong:"G3962",start:41,end:46},{text:"vida",strong:"G2222",start:59,end:63}]},{number:16,text:"Tambi\xe9n tengo otras ovejas que no son de este redil; aqu\xe9llas tambi\xe9n me conviene traer, y oir\xe1n mi voz; y habr\xe1 un reba\xf1o, y un pastor.",strong:[{text:"este",strong:"G3778",start:41,end:45},{text:"pastor",strong:"G4166",start:129,end:135}]},{number:17,text:"Por eso me ama el Padre, porque yo pongo mi vida, para volverla \xe1 tomar.",strong:[{text:"Padre",strong:"G3962",start:18,end:23},{text:"vida",strong:"G2222",start:44,end:48},{text:"tomar",strong:"G3880",start:66,end:71}]},{number:18,text:"Nadie me la quita, mas yo la pongo de m\xed mismo. Tengo poder para ponerla, y tengo poder para volverla \xe1 tomar. Este mandamiento recib\xed de mi Padre.",strong:[{text:"Nadie",strong:"G3762",start:0,end:5},{text:"poder",strong:"G1411",start:54,end:59},{text:"poder",strong:"G1411",start:82,end:87},{text:"tomar",strong:"G3880",start:104,end:109},{text:"Este",strong:"G3778",start:111,end:115},{text:"mandamiento",strong:"G1785",start:116,end:127},{text:"Padre",strong:"G3962",start:141,end:146}]},{number:19,text:"Volvi\xf3 \xe1 haber disensi\xf3n entre los Jud\xedos por estas palabras.",strong:[{text:"nouveau",strong:"G2537",start:12,end:19}]},{number:20,text:"Y muchos de ellos dec\xedan: Demonio tiene, y est\xe1 fuera de s\xed; \xbfpara qu\xe9 le o\xeds?",strong:[]},{number:21,text:"Dec\xedan otros: Estas palabras no son de endemoniado: \xbfpuede el demonio abrir los ojos de los ciegos?",strong:[]},{number:22,text:"Y se hac\xeda la fiesta de la dedicaci\xf3n en Jerusalem; y era invierno;",strong:[]},{number:23,text:"Y Jes\xfas andaba en el templo por el portal de Salom\xf3n.",strong:[{text:"dans",strong:"H6887",start:22,end:26}]},{number:24,text:"Y rode\xe1ronle los Jud\xedos y dij\xe9ronle: \xbfHasta cu\xe1ndo nos has de turbar el alma? Si t\xfa eres el Cristo, d\xednoslo abiertamente.",strong:[{text:"alma",strong:"G5590",start:72,end:76},{text:"Cristo",strong:"G5547",start:92,end:98}]},{number:25,text:"Respondi\xf3les Jes\xfas: Os lo he dicho, y no cre\xe9is: las obras que yo hago en nombre de mi Padre, ellas dan testimonio de m\xed;",strong:[{text:"nombre",strong:"G3686",start:74,end:80},{text:"Padre",strong:"G3962",start:87,end:92},{text:"testimonio",strong:"G3141",start:104,end:114}]},{number:26,text:"Mas vosotros no cre\xe9is, porque no sois de mis ovejas, como os he dicho.",strong:[{text:"como",strong:"G2531",start:54,end:58}]},{number:27,text:"Mis ovejas oyen mi voz, y yo las conozco, y me siguen;",strong:[{text:"brebis",strong:"G4263",start:4,end:10}]},{number:28,text:"Y yo les doy vida eterna y no perecer\xe1n para siempre, ni nadie las arrebatar\xe1 de mi mano.",strong:[{text:"vida",strong:"G2222",start:13,end:17},{text:"perecer",strong:"G622",start:30,end:37},{text:"siempre",strong:"H5769",start:45,end:52},{text:"nadie",strong:"G3762",start:57,end:62},{text:"mano",strong:"G5495",start:84,end:88}]},{number:29,text:"Mi Padre que me las di\xf3, mayor que todos es y nadie las puede arrebatar de la mano de mi Padre.",strong:[{text:"Padre",strong:"G3962",start:3,end:8},{text:"nadie",strong:"G3762",start:46,end:51},{text:"mano",strong:"G5495",start:78,end:82},{text:"Padre",strong:"G3962",start:89,end:94}]},{number:30,text:"Yo y el Padre una cosa somos.",strong:[{text:"Padre",strong:"G3962",start:8,end:13}]},{number:31,text:"Entonces volvieron \xe1 tomar piedras los Jud\xedos para apedrearle.",strong:[{text:"tomar",strong:"G3880",start:21,end:26}]},{number:32,text:"Respondi\xf3les Jes\xfas: Muchas buenas obras os he mostrado de mi Padre, \xbfpor cu\xe1l obra de esas me apedre\xe1is?",strong:[{text:"Padre",strong:"G3962",start:61,end:66},{text:"obra",strong:"G2041",start:78,end:82}]},{number:33,text:"Respondi\xe9ronle los Jud\xedos, diciendo: Por la buena obra no te apedreamos, sino por la blasfemia; y porque t\xfa, siendo hombre, te haces Dios.",strong:[{text:"obra",strong:"G2041",start:50,end:54},{text:"hombre",strong:"G444",start:116,end:122},{text:"Dios",strong:"G2316",start:133,end:137}]},{number:34,text:"Respondi\xf3les Jes\xfas: \xbfNo est\xe1 escrito en vuestra ley: Yo dije, dioses sois?",strong:[{text:"dioses",strong:"H430",start:62,end:68}]},{number:35,text:"Si dijo, dioses, \xe1 aquellos \xe1 los cuales fue hecha palabra de Dios (y la Escritura no puede ser quebrantada);",strong:[{text:"dioses",strong:"H430",start:9,end:15},{text:"palabra",strong:"G3056",start:51,end:58},{text:"Dios",strong:"G2316",start:62,end:66}]},{number:36,text:"\xbfA quien el Padre santific\xf3 y envi\xf3 al mundo, vosotros dec\xeds: T\xfa blasfemas, porque dije: Hijo de Dios soy?",strong:[{text:"Padre",strong:"G3962",start:12,end:17},{text:"mundo",strong:"G2889",start:39,end:44},{text:"Hijo",strong:"G5207",start:89,end:93},{text:"Dios",strong:"G2316",start:97,end:101}]},{number:37,text:"Si no hago las obras de mi Padre, no me cre\xe1is.",strong:[{text:"Padre",strong:"G3962",start:27,end:32}]},{number:38,text:"Mas si las hago, aunque \xe1 m\xed no cre\xe1is, creed \xe1 las obras; para que conozc\xe1is y cre\xe1is que el Padre est\xe1 en m\xed, y yo en el Padre.",strong:[{text:"Padre",strong:"G3962",start:94,end:99},{text:"Padre",strong:"G3962",start:123,end:128}]},{number:39,text:"Procuraban otra vez prenderle; mas \xe9l se sali\xf3 de sus manos;",strong:[]},{number:40,text:"Y volvi\xf3se tras el Jord\xe1n, \xe1 aquel lugar donde primero hab\xeda estado bautizando Juan; y est\xfavose all\xed.",strong:[{text:"primero",strong:"G4413",start:47,end:54},{text:"Juan",strong:"G2491",start:79,end:83}]},{number:41,text:"Y muchos ven\xedan \xe1 \xe9l, y dec\xedan: Juan, \xe1 la verdad, ninguna se\xf1al hizo; mas todo lo que Juan dijo de \xe9ste, era verdad.",strong:[{text:"Juan",strong:"G2491",start:32,end:36},{text:"verdad",strong:"G225",start:43,end:49},{text:"todo",strong:"G3956",start:75,end:79},{text:"Juan",strong:"G2491",start:87,end:91},{text:"verdad",strong:"G225",start:110,end:116}]},{number:42,text:"Y muchos creyeron all\xed en \xe9l.",strong:[{text:"dans",strong:"H6887",start:4,end:8}]}]},o=r}}]);
